        </div>
        <button className="navItem" onClick={ ()=>{ this.props.mostrar(props.texto) } } > <i className={props.icon + ' navIcon'} > </i> <span> {props.texto} </span> </button>
        <button className="navItem" onClick={ ()=>{ this.props.mostrar(props.texto) } } > <i className={props.icon + ' navIcon'} > </i> <span> {props.texto} </span> </button>
      </div>
    );
}

